import React,{Component} from 'react';
import {Link} from 'react-router-dom';



const home =()=>{
    return(
        <>


            <ul>
                <li><Link to="/">Home</Link></li>
                <li><Link to="/signup">Signup</Link></li>
                <li><Link to="/login">Login</Link></li>


            </ul>
            <div>
      Welcome to the Home Page!
    </div>


        </>
    )
}
export default home;
